import react from 'react';

const Contacts = () => {
    return(
            <div>
                <div className="Map">
                    <iframe src="https://www.google.com/maps/d/u/0/embed?mid=1rn1p3fQifjHESv2s4bhmSwbiohDkuQai"></iframe>
                </div>
                <div className="Localisation">
                    <ul></ul>
                </div>
            </div>
    );
};

export default Contacts;
